DROP TABLE MULTA_ATRASO CASCADE CONSTRAINTS;
DROP TABLE FORMA_PAGO CASCADE CONSTRAINTS;
DROP TABLE ESTADO_PERIODO CASCADE CONSTRAINTS;
DROP TABLE ESTADO_PAGO CASCADE CONSTRAINTS;
