-- CREACION DE OBJETOS
CREATE TABLE COMUNA
(id_comuna NUMBER(6) NOT NULL,
 nombre_comuna VARCHAR2(30) NOT NULL,
 CONSTRAINT PK_COMUNA PRIMARY KEY (id_comuna));

CREATE TABLE PERIODO_COBRO_GASTO_COMUN
(anno_mes_pcgc NUMBER(6) NOT NULL ,
 id_eperiodo NUMBER(2) NOT NULL ,
 CONSTRAINT PK_PERIODO_COBRO PRIMARY KEY (anno_mes_pcgc));

CREATE TABLE ESTADO_PAGO
(id_epago  NUMBER(2) NOT NULL ,
 descripcion_epago VARCHAR2 (50) NOT NULL,
 CONSTRAINT PK_ESTADO_PAGO PRIMARY KEY (id_epago));

CREATE TABLE ESTADO_PERIODO
(id_eperiodo NUMBER(2) NOT NULL,
 descripcion_eperiodo VARCHAR2 (50) NOT NULL ,
 CONSTRAINT PK_ESTADO_PERIODO PRIMARY KEY (id_eperiodo)) ;

CREATE TABLE FORMA_PAGO
(id_fpago   NUMBER(2) NOT NULL ,
 descripcion_fpago VARCHAR2 (50) NOT NULL ,
 CONSTRAINT PK_FORMA_PAGO PRIMARY KEY (id_fpago)) ;

CREATE TABLE TIPO_PERSONA
(id_tper NUMBER(1) NOT NULL,
 descripcion_tper VARCHAR2(20),
 CONSTRAINT PK_TIPO_PERSONA PRIMARY KEY (id_tper));

CREATE TABLE MULTA_ATRASO
(id_tramo_ma NUMBER(2) NOT NULL,
 fini_vig_ma DATE NOT NULL,
 fter_vig_ma DATE NOT NULL,
 tot_dias_inf_ma NUMBER(3) NOT NULL,
 tot_dias_sup_ma NUMBER(3) NOT NULL,
 porc_ma NUMBER(4,3) NOT NULL,
 CONSTRAINTS PK_MULTA_ATRASO PRIMARY KEY(id_tramo_ma, fini_vig_ma));

CREATE TABLE ADMINISTRADOR 
(numrun_adm NUMBER(10) NOT NULL, 
 dvrun_adm VARCHAR2(1) NOT NULL, 
 pnombre_adm VARCHAR2(50) NOT NULL, 
 snombre_adm VARCHAR2(50), 
 appaterno_adm VARCHAR2(50) NOT NULL, 
 apmaterno_adm VARCHAR2(50),
 foto_adm BLOB,
 CONSTRAINT PK_ADMINISTRADOR PRIMARY KEY (numrun_adm));

CREATE TABLE EDIFICIO
(id_edif NUMBER(5) NOT NULL ,
 nombre_edif VARCHAR2 (50) NOT NULL ,
 direccion_edif VARCHAR2(60) NOT NULL,
 numrun_adm NUMBER(10) NOT NULL,
 id_comuna NUMBER(6) NOT NULL,
 CONSTRAINT PK_EDIFICIO PRIMARY KEY (id_edif));

CREATE TABLE DEPARTAMENTO
(id_edif NUMBER(5) NOT NULL ,
 nro_depto NUMBER(5) NOT NULL,
 total_banos_depto NUMBER(2) NOT NULL,
 total_dormitorios_depto NUMBER(2) NOT NULL,
 total_balcones_depto NUMBER(2),
 metros_cuadrados_depto NUMBER(5,2) NOT NULL,
 porc_prorrateo_depto NUMBER (3,2) NOT NULL,
 CONSTRAINT PK_DEPARTAMENTO PRIMARY KEY (id_edif, nro_depto));

CREATE TABLE RESPONSABLE_PAGO_GASTO_COMUN
(numrun_rpgc NUMBER(10) NOT NULL ,
 dvrun_rpgc VARCHAR2(1) NOT NULL ,
 pnombre_rpgc VARCHAR2 (50) NOT NULL ,
 snombre_rpgc VARCHAR2(50),
 appaterno_rpgc VARCHAR2 (50) NOT NULL,
 apmaterno_rpgc VARCHAR2 (50),
 id_tper NUMBER(1) NOT NULL,
 CONSTRAINT PK_RESP_PAGO_GASTO_COMUN PRIMARY KEY (numrun_rpgc)) ;

CREATE TABLE GASTO_COMUN_PAGO_CERO
(anno_mes_pcgc NUMBER(6) NOT NULL,
 id_edif NUMBER(5) NOT NULL,
 nombre_edif VARCHAR2(30) NOT NULL,
 run_administrador VARCHAR2(20) NOT NULL,
 nombre_admnistrador VARCHAR2(60) NOT NULL,
 nro_depto NUMBER(5) NOT NULL,
 run_responsable_pago_gc VARCHAR2(20) NOT NULL,
 nombre_responsable_pago_gc VARCHAR2(60) NOT NULL,
 valor_multa_pago_cero NUMBER(5) NOT NULL,
 observacion VARCHAR2(80) NOT NULL,
 CONSTRAINT PK_GASTO_COMUN_PAGO_CERO PRIMARY KEY (anno_mes_pcgc,id_edif, nro_depto));

CREATE TABLE GASTO_COMUN
(anno_mes_pcgc NUMBER(6) NOT NULL ,
 id_edif NUMBER(5) NOT NULL,
 nro_depto NUMBER(5) NOT NULL,
 fecha_desde_gc DATE NOT NULL ,
 fecha_hasta_gc DATE NOT NULL ,
 prorrateado_gc NUMBER(10) NOT NULL ,
 fondo_reserva_gc NUMBER(10) NOT NULL,
 agua_individual_gc NUMBER(10) NOT NULL ,
 combustible_individual_gc NUMBER(10) NOT NULL ,
 lavanderia_gc NUMBER(10),
 evento_gc NUMBER(10),
 servicio_gc NUMBER(10),
 monto_atrasado_gc NUMBER(10) ,
 multa_gc NUMBER(10) ,
 monto_total_gc NUMBER(10) NOT NULL,
 fecha_pago_gc DATE NOT NULL, 
 id_epago NUMBER(2) NOT NULL,
 numrun_rpgc NUMBER(10) NOT NULL,
 CONSTRAINT PK_GASTO_COMUN PRIMARY KEY (anno_mes_pcgc,id_edif, nro_depto));
 
 
 CREATE TABLE RESUMEN_GASTO_COMUN
(anno_mes_pcgc NUMBER(6) NOT NULL,
 id_edif NUMBER(5) NOT NULL,
 prorrateado_gc NUMBER(10) NOT NULL ,
 fondo_reserva_gc NUMBER(10) NOT NULL,
 agua_individual_gc NUMBER(10) NOT NULL ,
 combustible_individual_gc NUMBER(10) NOT NULL ,
 lavanderia_gc NUMBER(10),
 evento_gc NUMBER(10),
 servicio_gc NUMBER(10),
 monto_atrasado_gc NUMBER(10) ,
 multa_gc NUMBER(10) ,
 monto_total_gc NUMBER(10) NOT NULL,
 CONSTRAINT PK_RESUMEN_GASTO_COMUN PRIMARY KEY (anno_mes_pcgc,id_edif));

CREATE TABLE PAGO_GASTO_COMUN
(anno_mes_pcgc NUMBER(6,0) NOT NULL, 
 id_edif NUMBER(5,0) NOT NULL, 
 nro_depto NUMBER(5,0) NOT NULL,
 fecha_cancelacion_pgc DATE NOT NULL, 
 monto_cancelado_pgc NUMBER(10) NOT NULL,
 id_fpago NUMBER(2,0) NOT NULL,
 CONSTRAINT PK_PAGO_GASTO_COMUN PRIMARY KEY (anno_mes_pcgc,id_edif, nro_depto,fecha_cancelacion_pgc));


CREATE SEQUENCE seq_com START WITH 10 INCREMENT BY 10;

ALTER TABLE EDIFICIO ADD CONSTRAINT FK_EDIFICIO_ADMINISTRADOR FOREIGN KEY(numrun_adm) REFERENCES ADMINISTRADOR(numrun_adm);
ALTER TABLE EDIFICIO ADD CONSTRAINT FK_EDIFICIO_COMUNA FOREIGN KEY(id_comuna) REFERENCES COMUNA(id_comuna);
ALTER TABLE DEPARTAMENTO ADD CONSTRAINT FK_DEPARTAMENTO_EDIFICIO FOREIGN KEY(id_edif) REFERENCES EDIFICIO(id_edif);
ALTER TABLE GASTO_COMUN_PAGO_CERO ADD CONSTRAINT FK_GCOMUNCERO_GASTO_COMUN FOREIGN KEY(anno_mes_pcgc,id_edif, nro_depto) REFERENCES GASTO_COMUN (anno_mes_pcgc,id_edif, nro_depto);
ALTER TABLE RESPONSABLE_PAGO_GASTO_COMUN ADD CONSTRAINT FK_RESP_PAGO_GC_TP_PERSONA FOREIGN KEY(id_tper) REFERENCES TIPO_PERSONA(id_tper);
ALTER TABLE GASTO_COMUN ADD CONSTRAINT FK_GCOMUN_PERIODO_COBRO FOREIGN KEY(anno_mes_pcgc) REFERENCES PERIODO_COBRO_GASTO_COMUN(anno_mes_pcgc);
ALTER TABLE GASTO_COMUN ADD CONSTRAINT FK_GCOMUN_DEPARTAMENTO FOREIGN KEY(id_edif, nro_depto) REFERENCES DEPARTAMENTO (id_edif, nro_depto);
ALTER TABLE GASTO_COMUN ADD CONSTRAINT FK_GCOMUN_RESP_PAGO_GC FOREIGN KEY(numrun_rpgc) REFERENCES RESPONSABLE_PAGO_GASTO_COMUN(numrun_rpgc);
ALTER TABLE GASTO_COMUN ADD CONSTRAINT FK_GCOMUN_ESTADO_PAGO FOREIGN KEY(id_epago) REFERENCES ESTADO_PAGO(id_epago);
ALTER TABLE PERIODO_COBRO_GASTO_COMUN ADD CONSTRAINT FK_PER_COBRO_ESTADO_PERIODO FOREIGN KEY (id_eperiodo) REFERENCES ESTADO_PERIODO (id_eperiodo) ;
ALTER TABLE PAGO_GASTO_COMUN ADD CONSTRAINT FK_PGCOMUN_GCOMUN FOREIGN KEY(anno_mes_pcgc,id_edif, nro_depto) REFERENCES GASTO_COMUN (anno_mes_pcgc,id_edif, nro_depto);
ALTER TABLE PAGO_GASTO_COMUN ADD CONSTRAINT FK_PGCOMUN_FORMA_PAGO FOREIGN KEY(id_fpago) REFERENCES FORMA_PAGO(id_fpago);

